    false,nt"url": null,nt"notes": "This narrative report for Arrowwood Migratory
    Waterfowl Refuge outlines Refuge accomplishments from February through April of
    1940. The report begins by summarizing the weather conditions during this period.
    Wildlife- including migratory birds, upland game birds, furbearers, predators, and
    rodents- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. Resource management
    is outlined; topics include share cropping. The public relations section of the
    report describes Refuge visitors and violations. Photographs are attached.",nt"owner_org":
